async function fetchProfiles(){const e=document.getElementById("usernames").value.split("\n").map((e=>e.trim())).filter((e=>e.length>0));if(0===e.length)return void alert("Please enter at least one username");const t=document.getElementById("result");t.textContent="Fetching profiles...";try{const n=await fetch("fetch_profiles.php",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({usernames:e})}),s=await n.json();t.textContent=JSON.stringify(s,null,2)}catch(e){t.textContent="Error fetching profiles: "+e.message}}